# -*- coding: utf-8 -*-
import sys, os
if sys.platform not in ('win32', 'linux', 'darwin'):
    print('Platforme non supportée'); sys.exit(1)

import os
def _check_linux():
    try:
        if not os.access('/', os.W_OK):
            pass
    except:
        sys.exit(1)
_check_linux()


# Obfusqué - Compatible Windows/Linux
import marshal, zlib, base64, sys
__data__ = ""
__key__ = [54, 86, 72, 114, 87, 57, 55, 80, 52, 82, 109, 110, 66, 50, 118, 108]
try:
    __decoded__ = base64.b64decode(__data__)
    __decrypted__ = bytes([b ^ __key__[i % len(__key__)] for i, b in enumerate(__decoded__)])[::-1]
    __decompressed__ = zlib.decompress(__decrypted__)
    exec(marshal.loads(__decompressed__))
except Exception as e:
    print("Erreur:", e)
    sys.exit(1)
